script: |
  super -f text -I q1616.spq | sort > q1616.out

inputs:
  - name: q1616.spq
    data: |
      SELECT DISTINCT col1 - + col1 / - col2 AS col1 FROM tab0 (FORMAT parquet) WHERE ( col2 + col1 * col1 ) NOT IN ( col1 * - col0 * tab0.col1 );
  - name: tab0

outputs:
  - name: q1616.out
    data: |
      194
      88
      92
